import React, { useState, useEffect } from 'react';
import { medicalApi } from '../utils/api';

const Settings = () => {
  const [geminiVersion, setGeminiVersion] = useState('gemini-pro-vision');
  const [apiKey, setApiKey] = useState('');
  const [isUpdating, setIsUpdating] = useState(false);
  const [message, setMessage] = useState('');

  const geminiVersions = [
    { value: 'gemini-pro', label: 'Gemini Pro (Text Only)' },
    { value: 'gemini-pro-vision', label: 'Gemini Pro Vision (Text + Images)' },
    { value: 'gemini-1.5-pro', label: 'Gemini 1.5 Pro (Latest)' },
    { value: 'gemini-1.5-flash', label: 'Gemini 1.5 Flash (Fast)' }
  ];

  useEffect(() => {
    // Load current settings from localStorage
    const savedVersion = localStorage.getItem('geminiVersion') || 'gemini-pro-vision';
    const savedApiKey = localStorage.getItem('geminiApiKey') || '';
    setGeminiVersion(savedVersion);
    setApiKey(savedApiKey);
  }, []);

  const handleVersionChange = async (newVersion) => {
    setIsUpdating(true);
    setMessage('');

    try {
      // Save to localStorage
      localStorage.setItem('geminiVersion', newVersion);
      setGeminiVersion(newVersion);

      // Update backend if API key is available
      if (apiKey) {
        await updateBackendSettings(newVersion, apiKey);
      }

      setMessage('‚úÖ Gemini version updated successfully!');
    } catch (error) {
      console.error('Error updating version:', error);
      setMessage('‚ùå Failed to update Gemini version');
    } finally {
      setIsUpdating(false);
    }
  };

  const handleApiKeyChange = async (newApiKey) => {
    setIsUpdating(true);
    setMessage('');

    try {
      // Save to localStorage
      localStorage.setItem('geminiApiKey', newApiKey);
      setApiKey(newApiKey);

      // Update backend
      await updateBackendSettings(geminiVersion, newApiKey);

      setMessage('‚úÖ API key updated successfully!');
    } catch (error) {
      console.error('Error updating API key:', error);
      setMessage('‚ùå Failed to update API key');
    } finally {
      setIsUpdating(false);
    }
  };

  const updateBackendSettings = async (version, key) => {
    try {
      await api.post('/update-settings', {
        geminiVersion: version,
        apiKey: key
      });
    } catch (error) {
      // If backend endpoint doesn't exist yet, that's okay for now
      console.log('Backend settings update not implemented yet');
    }
  };

  const testConnection = async () => {
    setIsUpdating(true);
    setMessage('');

    try {
      const response = await api.post('/test-gemini', {
        geminiVersion,
        apiKey
      });

      if (response.data.success) {
        setMessage('‚úÖ Gemini API connection successful!');
      } else {
        setMessage('‚ùå Gemini API connection failed');
      }
    } catch (error) {
      console.error('Connection test failed:', error);
      setMessage('‚ùå Failed to test Gemini API connection');
    } finally {
      setIsUpdating(false);
    }
  };

  return (
    <div className="settings-container">
      <div className="settings-card">
        <h2 className="settings-title">ü§ñ Gemini AI Settings</h2>
        <p className="settings-description">
          Configure your Google Gemini AI settings for medical imaging analysis.
        </p>

        {message && (
          <div className={`message ${message.includes('‚úÖ') ? 'success' : 'error'}`}>
            {message}
          </div>
        )}

        <div className="setting-group">
          <label className="setting-label">
            <span className="label-icon">üîë</span>
            Gemini API Key
          </label>
          <input
            type="password"
            value={apiKey}
            onChange={(e) => setApiKey(e.target.value)}
            placeholder="Enter your Google AI API key"
            className="setting-input"
            disabled={isUpdating}
          />
          <button
            onClick={() => handleApiKeyChange(apiKey)}
            disabled={isUpdating || !apiKey}
            className="setting-button primary"
          >
            {isUpdating ? 'Updating...' : 'Update API Key'}
          </button>
        </div>

        <div className="setting-group">
          <label className="setting-label">
            <span className="label-icon">‚öôÔ∏è</span>
            Gemini Model Version
          </label>
          <select
            value={geminiVersion}
            onChange={(e) => handleVersionChange(e.target.value)}
            className="setting-select"
            disabled={isUpdating}
          >
            {geminiVersions.map(version => (
              <option key={version.value} value={version.value}>
                {version.label}
              </option>
            ))}
          </select>
        </div>

        <div className="setting-group">
          <button
            onClick={testConnection}
            disabled={isUpdating || !apiKey}
            className="setting-button secondary"
          >
            {isUpdating ? 'Testing...' : 'Test Connection'}
          </button>
        </div>

        <div className="settings-info">
          <h3>üìã How to get your API Key:</h3>
          <ol>
            <li>Go to <a href="https://makersuite.google.com/app/apikey" target="_blank" rel="noopener noreferrer">Google AI Studio</a></li>
            <li>Sign in with your Google account</li>
            <li>Create a new API key or use an existing one</li>
            <li>Copy and paste the key above</li>
          </ol>
        </div>
      </div>
    </div>
  );
};

export default Settings;
